  <table class="table table-bordered table-hover" style="background-color: lightgrey;">
    <thead class="thead-dark">
      <tr>
        <th style="width: 40%;">Requestor Name</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let requests of request">
        <td>{{ requests.requestorName }}</td>
      </tr>
    </tbody>
  </table>
</div>
